const styles = {

    footer: {
        marginTop: 43
    },

    inputContainer: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        marginBottom: 8,
        borderWidth: 0,
    },

    input_nasc_dia: {
        flex: 1,
        height: 60,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginRight: 4,
        paddingHorizontal: 24,
        borderWidth: 0,
    },

    input_nasc_mes: {
        flex: 1,
        height: 60,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginHorizontal: 4,
        paddingHorizontal: 24,
        borderWidth: 0,
    },

    input_nasc_ano: {
        flex: 1,
        height: 60,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginLeft: 4,
        paddingHorizontal: 24,
        borderWidth: 0,
    },

    title: {
        color: '#322153',
        fontSize: 20,
        fontFamily: 'Ubuntu_700Bold',
        maxWidth: 260,
        marginTop: -50,
        marginLeft: 140
    },
}

export default styles;
